import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../services/api';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const createClickButton = async (e) => {
    e.preventDefault();
    try {
      const response = await api.post('/auth/login', { email, password });
      sessionStorage.setItem('usuario', email);
      navigate('/produto');
    } catch (error) {
      alert(error.response?.data?.message || 'E-mail ou senha inválidos');
    }
  };

  return (
    <div className="container">
      <form onSubmit={createClickButton}>
        <nav>
          <a href="/">Login</a> | 
          <a href="/usuario">Usuários</a> | 
          <a href="/produto">Produtos</a> | 
          <a href="/venda">Vendas</a>
        </nav>
        <div className="login--container">
          <h2>Login</h2>
          <label>Email</label>
          <input
            type="email"
            value={email}
            placeholder="Digite o email"
            onChange={(e) => setEmail(e.target.value)}
            required
          />
          <br />
          <label>Password</label>
          <input
            type="password"
            value={password}
            placeholder="Digite a senha"
            onChange={(e) => setPassword(e.target.value)}
            required
          />
          <br />
          <button className="login--buttton" type="submit">Entrar</button>
          <br /><br />
          <a href="/usuario">Cadastre-se</a>
        </div>
      </form>
    </div>
  );
};

export default Login;
